import { Button } from '@material-ui/core'
import React from 'react'
import { useNavigate } from 'react-router'
import "../styles/main.css"
function Banner() {

    let history = useNavigate()

    const priceRedirect = () => {
        history("/price")
    }

    const placeHolder = () => {
        history("/placeholder")
    }

    return (
            <div className="position-absolute top-50 start-50 translate-middle text-bg-dark p-3"> 
                <div className="banner_title_head" >AutoWatch</div>
                <h1>test</h1>
                <div className="banner_title_tail">
                    <div className="typing">A Machine Learning based Web Application for market price recommendation of cars</div>
                    <div className="banner__buttons">
                        <button onClick={priceRedirect} type="button" class="btn btn-outline-dark">Price Recommender</button>
                        <button onClick={placeHolder} type="button" class="btn btn-outline-dark">Place Holder</button>

                    </div>

                </div>
            </div>
    )
}

export default Banner
